import MainComponent from "components/detay";
import Footer from "layout/web/Footer/Footer";
import Header from "layout/web/Header/Header";
import NavbarMenu from "layout/web/navbar/Navbar";
import router, { useRouter } from "next/router";
import pointsU from "points";
import { useEffect } from "react";
import { postData } from "utils/fetchData";

const Home = ({data}) => {

  return(
    <div className="home_page">
      <Header data={data}/>
      <NavbarMenu/>
      <MainComponent/>
      <Footer/>
    </div>
  )
}
// This function gets called at build time on server-side.
// It won't be called on client-side, so you can even do
// direct database queries.
export async function getStaticProps() {
  // Call an external API endpoint to get posts.
  // You can use any data fetching library
  const data = await postData(pointsU.sgetCardContent , { systemId: 1, categoryId: "5" });

  // By returning { props: { posts } }, the Blog component
  // will receive `posts` as a prop at build time
  return {
    props: {
      data,
    },
  }
}

export default Home;
